('101','1','Свежие тюльпаны в коробочках','Предлагаем вам ознакомиться с нашим новым ассортиментом - тюльпаны в коробочках. Это наилучший подарок для вашей любимой на праздник!','/products','Каталог тюльпанов','2e359a0af1f3ae858036ed4992300b29.jpg','113','0'),
('103','2','Цена','У нас одни из самых приемлемых цен в регионе.','','','b1f5eb78bc2ab2c9a8df59ca80d11d56.png','103','1'),
('102','1','Премиум букеты для состоятельных клиентов','Предлагаем вам ознакомиться с нашим новым ассортиментом - тюльпаны в коробочках. Это наилучший способ порадовать вашу любимую.','/products','Перейти в раздел','1b483cb821022820e11fcd0db2ceb9a4.jpg','111','0'),
('104','2','Выбор','Наш ассортимент насчитывает более тысячи различных цветов и растений.','/products','','9873986cc62ea89c2eb6ef62cfad79bb.png','104','1'),
('105','2','Качество','Цветы в нашем магазине всегда первой свежести. Даем гарантию!','','','154da28be061fa8e8e9eeb8095d53a19.png','105','1'),
('106','2','Доставка','Есть возможность поздней/ранней доставки при заблаговременном заказе.  \r\n','','','561b023e90278f75506591e5e022fc74.png','106','1'),
('107','2','Отзывы','9 клиентов из 10 советуют наш магазин своим друзьям и знакомым.','/reviews','','95ac0932967cc88385eaf07a9f17d685.png','107','1'),
('108','4','Название баннера','','/catalog/bukety','','837bc5957b0f6f769b092531dd0ece0a.jpg','108','1'),
('109','4','Заголовок','','/catalog/rozy','','49a4d39614f207fcac74daec6fb42480.jpg','109','1'),
('110','1','Love is...','.. дарить любимой цветы.\r\n \r\nУже доступна бронь букетов к 14 февраля. Не упусти момент! ','/catalog/bukety','Выбрать букет','d850e4fb64e097b89c43b52ec48ffe8e.jpg','114','0'),
('112','1','Цветы для вашего события','\"Fiori\" – это интернет-магазин цветов. Мы дарим хорошее настроение и с радостью порадуем вас своими оригинальными букетами. Выбираете Вы -доставляем мы. ','','','94b43b71bee63b7bff42c61e90201bf9.jpg','110','1'),
('111','1','День святого Валентина! ','Главный день в году для романтиков...\r\nВыразить свои чувства ещё никогда не было так просто! \r\nУже доступна бронь букетов на 14 февраля. Не упусти момент! ','/catalog/bukety','Выбрать букет','3239032e824152161fdb7af512effd21.jpg','102','0'),
('113','1','Розы для любимых','Большой выбор букетов из роз. В составе композиций используются схожие по форме и размерам экземпляры без каких-либо дефектов. Исключительно свежие цветы для ваших букетов. ','/catalog/rozy','Выбрать букет','7fe6fec40ee3f7ede9e5bc6a8e041bb6.jpg','115','1'),
('114','1','Тюльпаны на 8 марта!','В женский день порадуйте своих любимых букетом свежих цветов. Букет из Тюльпанов - прекрасный способ выразить свои чувства. ','/catalog/tyulpany','Выбрать букет из тюльпанов ','cd44e67d7e79bacdb7fa9ac0850685fa.jpg','101','1'),
('115','1','Эффектные букеты из свежих лилий!','Вы можете заказать букет на нашем сайте, либо позвонив по телефону, который указан выше. Мы ценим ваше время, поэтому с удовольствием доставим вам букет сами! ','/catalog/lilii','Посмотреть букеты','3aba3b2abd430989c541c783b3636eb7.jpg','112','1'),
('116','1','Букеты из орхидей','Вы всегда можете заказать букет из свежих орхидей с доставкой на дом или в офис по Воронежу. Мы ценим ваше время!','/catalog/orhidei','Посмотреть букеты','cc463d76bf7ba5a76b6b870c559365b7.jpg','116','1');
