INSERT INTO `s_blog` (`id`, `name`, `image`, `url`, `meta_title`, `meta_keywords`, `meta_description`, `annotation`, `text`, `visible`, `date`) VALUES
('4','Снова в школу!','39636_3.jpg','snova-v-shkolu','Снова в школу!','Снова в школу!','Уважаемые покупатели!   В интернет-магазине &laquo;SmartyCMS&raquo; представлены букеты цветов ко Дню знаний, которые порадую Вас не только своей красотой, но и доступностью цен.','<p><span>Уважаемые покупатели!</span><br /><span>В интернет-магазине&nbsp;&laquo;SmartyCMS&raquo;&nbsp;представлены букеты цветов ко Дню знаний, которые порадую Вас не только своей красотой, но и доступностью цен.</span></p>','<p><span>Уважаемые покупатели!</span><br /><span>В интернет-магазине&nbsp;&laquo;SmartyCMS&raquo;&nbsp;представлены букеты цветов ко Дню знаний, которые порадую Вас не только своей красотой, но и доступностью цен.</span></p><p><span>Самый главный праздник осени&nbsp;для миллионов детей и их родителей&nbsp;- День знаний! В этот день проходят торжественные линейки, посвященные началу учебного года, радостные встречи со школьными друзьями и учителями.&nbsp;И уж совсем особым этот день является для первоклашек и их родителей. А какой торжественный момент обходится без цветов?</span></p>','0','2017-01-15 00:00:00'),
('5','И у нас Хэллоуин!','3442.jpeg','i-u-nas-hellouin','И у нас Хэллоуин!','И у нас Хэллоуин!','Настоящий праздник страшилок, мистики и колдовства с тыквенным привкусом!','<p><span>Настоящий праздник страшилок, мистики и колдовства с тыквенным привкусом!</span></p>','<p><span>Настоящий праздник страшилок, мистики и колдовства с тыквенным привкусом!</span></p><div class=\"detail_text\" id=\"text_62412\">Хэллоуин или День всех святых - это праздник, который&nbsp;восходит к традициям древних кельтов Ирландии и Шотландии. Не смотря на это, это праздник&nbsp;набирает все большую популярность среди российской молодежи. Дата празднования вот уже много лет остается неизменной - последний&nbsp;октябрьский день.</div><div class=\"detail_text\"><br />Интернет-магазин&nbsp;&laquo;SmartyCMS&raquo; предлагает Вам&nbsp;прекрасные тематические цветочные композиции и&nbsp;оригинальные интерпретации традиционных атрибутов этого праздника. Все это&nbsp;поможет Вам создать незабываемую атмосферу мистического&nbsp;праздника&nbsp;Хэллоуин.&nbsp;</div>','0','2017-01-15 00:00:00'),
('6','Коллекция зимних букетов','36.jpg','kollektsiya-zimnih-buketov','Коллекция зимних букетов','Коллекция зимних букетов','Lorem Ipsum   - это текст-\"рыба\", часто используемый в печати и вэб-дизайне. Lorem Ipsum является стандартной \"рыбой\" для текстов на латинице с начала XVI века.','<p><strong>Lorem Ipsum</strong><span>&nbsp;- это текст-\"рыба\", часто используемый в печати и вэб-дизайне. Lorem Ipsum является стандартной \"рыбой\" для текстов на латинице с начала XVI века.</span></p>','<div><h2><strong style=\"font-size: 13px; color: #404040;\">Lorem Ipsum</strong><span style=\"font-size: 13px; color: #404040;\">&nbsp;- это текст-\"рыба\", часто используемый в печати и вэб-дизайне. Lorem Ipsum является стандартной \"рыбой\" для текстов на латинице с начала XVI века. В то время некий безымянный печатник создал большую коллекцию размеров и форм шрифтов, используя Lorem Ipsum для распечатки образцов. Lorem Ipsum не только успешно пережил без заметных изменений пять веков, но и перешагнул в электронный дизайн. Его популяризации в новое время послужили публикация листов Letraset с образцами Lorem Ipsum в 60-х годах и, в более недавнее время, программы электронной вёрстки типа Aldus PageMaker, в шаблонах которых используется Lorem Ipsum.</span></h2></div><div><h2></h2><h2>Почему он используется?</h2><p>Давно выяснено, что при оценке дизайна и композиции читаемый текст мешает сосредоточиться. Lorem Ipsum используют потому, что тот обеспечивает более или менее стандартное заполнение шаблона, а также реальное распределение букв и пробелов в абзацах, которое не получается при простой дубликации \"Здесь ваш текст.. Здесь ваш текст.. Здесь ваш текст..\" Многие программы электронной вёрстки и редакторы HTML используют Lorem Ipsum в качестве текста по умолчанию, так что поиск по ключевым словам \"lorem ipsum\" сразу показывает, как много веб-страниц всё ещё дожидаются своего настоящего рождения. За прошедшие годы текст Lorem Ipsum получил много версий. Некоторые версии появились по ошибке, некоторые - намеренно (например, юмористические варианты).</p></div>','0','2017-01-15 00:00:00'),
('7','Букеты в шляпных коробках','785.750x0.jpeg','bukety-v-shlyapnyh-korobkah','Букеты в шляпных коробках','Букеты в шляпных коробках','Многие думают, что Lorem Ipsum - взятый с потолка псевдо-латинский набор слов, но это не совсем так.','<p><span>Многие думают, что Lorem Ipsum - взятый с потолка псевдо-латинский набор слов, но это не совсем так.</span></p>','<p>Многие думают, что Lorem Ipsum - взятый с потолка псевдо-латинский набор слов, но это не совсем так. Его корни уходят в один фрагмент классической латыни 45 года н.э., то есть более двух тысячелетий назад. Ричард МакКлинток, профессор латыни из колледжа Hampden-Sydney, штат Вирджиния, взял одно из самых странных слов в Lorem Ipsum, \"consectetur\", и занялся его поисками в классической латинской литературе. В результате он нашёл неоспоримый первоисточник Lorem Ipsum в разделах 1.10.32 и 1.10.33 книги \"de Finibus Bonorum et Malorum\" (\"О пределах добра и зла\"), написанной Цицероном в 45 году н.э. Этот трактат по теории этики был очень популярен в эпоху Возрождения. Первая строка Lorem Ipsum, \"Lorem ipsum dolor sit amet..\", происходит от одной из строк в разделе 1.10.32</p><p>Классический текст Lorem Ipsum, используемый с XVI века, приведён ниже. Также даны разделы 1.10.32 и 1.10.33 \"de Finibus Bonorum et Malorum\" Цицерона и их английский перевод, сделанный H. Rackham, 1914 год.</p>','0','2017-01-15 00:00:00');
