('90','41','Поздравление','Купить букет цветов для поздравления - заказать дешево с доставкой в Воронеже','Поздравление','','','pozdravlenie','','148','1',''),
('54','53','Фруктовые букеты','Купить фруктовый букет - заказать дешево с доставкой в Воронеже','Фруктовые букеты','','','fruktovye-bukety','','179','0',''),
