INSERT INTO `s_comments` (`id`, `date`, `ip`, `object_id`, `name`, `image`, `email`, `otvet`, `text`, `rate`, `type`, `approved`) VALUES
('109','2018-02-22 10:14:13','94.244.43.171','15','Алина','14063198_1253297541379443_403508892_n.jpg','',null,'Спасибо за качественную работу! Красивый, нежный букет. Именинница была в восторге, все на празднике перефоткались с ним в инстаграм)). ','5','feedback','1'),
('87','2018-01-15 15:20:41','91.204.60.9','15','Алексей','5.jpg','',null,'БОЛЬШОЕ СПАСИБО!! Очень удобно, с утра заказал и к вечеру они уже у меня!',null,'feedback','1'),
('88','2018-01-15 15:21:48','91.204.60.9','15','Светлана','d8ce428015.jpg','','','Цветочки очень свежие)) Теперь буду заказывать только у вас!))','0','feedback','1'),
('92','2018-01-15 15:41:07','194.154.75.198','15','Артур',null,'','','При доставке курьер застрял в пробке, поэтому припоздал немного. Но букет был крутой, так что всё ок. Спасибо! ','0','feedback','1'),
('89','2018-01-15 15:24:17','91.204.60.9','15','Олег','1_2.jpg','',null,'заказывал розы на день рождение коллеги, удобно то, что заказ можно оплатить курьеру!','5','feedback','1'),
('90','2018-01-15 15:26:12','91.204.60.9','15','Евгения','2.jpg','','','Композицию сделали так как я просила, получилось очень красиво! СПАСИБО','5','feedback','1'),
('91','2018-01-15 15:30:39','91.204.60.9','15','Влад','buket-iz-krasnyh-roz.1920x.jpg','','','сервис отличный, очень выручает когда нет времени.. курьер привез заказ вовремя','5','feedback','1'),
('93','2018-01-15 16:06:18','194.154.75.198','15','Майя','photo_2018-01-15_16-09-52.png','','','Спасибо огромное за отлично выполненный заказ! Очень понравились цветы и оформление! Приятно, что есть такие компании с таким сервисом. Я рада, что я смогла подарить букет живых цветов, благодаря Вам. Желаю Вашей компании процветания!','0','feedback','1'),
('94','2018-01-15 16:16:58','93.79.168.101','15','Инна','2351fd4127.1920x.jpg','','','Спасибо за быструю доставку! Нужно было срочно поздравить коллегу, привезли очень оперативно прямо в оффис, розы прям \"хрустят\"!','5','feedback','1'),
('95','2018-01-15 16:19:44','93.79.168.101','15','Игнат','46bdd7b444.1920x.jpg','','','Очень рад возможности баловать свою любимую прекрасными цветами!  Доставили цветы в оговоренное время, у меня и у девушки - только самые положительные впечатления)','5','feedback','1'),
('96','2018-01-15 16:21:26','93.79.168.101','15','Анна','ca12147662.1920x.jpg','','','Очень удобно выбирать, букет полностью соответствует картинке. Не пожалела что обратилась к вам. Очень качественный сервис!','0','feedback','1'),
('97','2018-01-15 16:24:10','93.79.168.101','15','Ирина','c2c8f57098.1920x.jpg','','','Приятно удивила пунктуальность доставки. Букет хоть и небольшой, но смотрится невероятно шикарно! Цветы красивенькие, ароматные. Теперь за букетиками только сюда.','5','feedback','1'),
('98','2018-01-15 16:28:43','93.79.168.101','15','Роман','d1563e7e0b.1920x.jpg','','','Уже не в первый раз пользуюсь услугами вашего сайта. Для меня - это отличный вариант при бешеном графике работы успевать делать приятно любимым женщинам. Обслуживание хорошее, дамы довольны))))','5','feedback','1'),
('99','2018-01-15 16:47:51','178.150.85.244','15','Анна','7189668.jpg','','','Спасибо, букет был очень  яркий, красивый, очень понравился! ','0','feedback','1'),
('100','2018-01-15 16:51:09','178.150.85.244','15','Игорь','966eba39a6.jpg','','','Спасибо! Букет привезли вовремя, радости именинницы не было предела! Хочу поблагодарить всех работников этого магазина. ','5','feedback','1'),
('101','2018-01-15 16:53:32','178.150.85.244','15','Свелана','53b11bcfabeedea0da9de640f8d1521c--pretty-flowers_1.jpg','','','Спасибо за чудесный букет и возможность поздравить близкого человека, когда находишься в другом городе ! Букет получился крутой!','5','feedback','1'),
('103','2018-01-15 17:00:46','178.150.85.244','15','Инга','photo_2018-01-15_16-29-28.1920x.jpg','','','Заказывала букет невесты. Очень долго объясняла что именно я хочу, боялась что что-то будет не так. Но результат меня порадовал. СПАСИБО!','0','feedback','1'),
('102','2018-01-15 16:56:58','178.150.85.244','15','Владимир','9392b28bf0e9806b7a411a3a97be363a_1.jpg','','','Доставкой доволен, цветы понравились получателю! Огромное спасибо менеджеру за помощь в выборе букета. ','5','feedback','1'),
('104','2018-01-15 17:10:53','194.154.75.198','15','Алексей',null,'',null,'Букет красивый, но доставку ждал дольше, чем планировал. За это 4.\r\nХотя, по сравнению с остальными, здесь она цена доставки дешевле всего. ','4','feedback','1'),
('105','2018-01-15 17:12:44','194.154.75.198','15','Артём',null,'',null,'Я немного тупанул и назвал не тот адрес при разговоре по заказу )) \r\nСпасибо, что всё равно мне доставили букет!!! ',null,'feedback','1'),
('108','2018-02-20 15:02:14','194.154.75.198','15','Константин',null,'',null,'Быстро, недорого и цветы красивые.\r\nНи раз выручали, спасибо!','5','feedback','1'),
('110','2018-03-01 11:32:46','93.79.168.101','15','Роман',null,'',null,'Заказывал букет роз. Цветы - как на картинке. Сервис отличный, оплатил курьеру при получении. Очень удобно.','5','feedback','1');
