('12','usloviya-dostavki','Доставка','Доставка','Принимаем заказы на сайте и по телефону, указанному в шапке сайта  &uarr; . После оплаты, заказ отправится на обработку во флористическую мастерскую  . Курьер доставит готовый букет получателю к указанному времени.                   Стоимость доставки     Cтоимость доставки    БЕСПЛАТНАЯ!    (в черте города Воронеж).','Доставка','<p><span><img src=\"/files/uploads/about-delivery.png\" style=\"float: left; width: 15%; margin: 0px 20px 20px 0px;\" /></span></p><p><span style=\"font-size: 13px;\"><br /></span></p><p><span style=\"font-size: 13px;\">Принимаем заказы на&nbsp;сайте и&nbsp;по&nbsp;телефону, указанному в шапке сайта <span>&uarr;</span>. После&nbsp;оплаты, заказ отправится на&nbsp;обработку во&nbsp;флористическую мастерскую</span><span style=\"font-size: 13px;\">. Курьер доставит готовый букет получателю к&nbsp;указанному времени.</span></p><p><span><br /></span></p><p><span><br /></span></p><h2><span style=\"color: #c72e89;\"><br /></span></h2><p><span style=\"color: #c72e89; font-size: 19px;\">Стоимость доставки</span></p><ul><li><span style=\"font-size: 13px;\">Cтоимость доставки</span><span style=\"font-size: 13px;\">&nbsp;<strong>БЕСПЛАТНАЯ!</strong></span><span style=\"font-size: 13px;\">&nbsp;(в черте города Воронеж).</span></li></ul><p><span><span><br /></span></span></p><p><span><span><br /></span></span></p><p style=\"text-align: center;\"><span><span><img src=\"/files/uploads/rabotaem.jpg\" style=\"width: 90%;\" /></span></span></p>','1','12','1','Доставка'),
('13','contact','Контакты','Контакты','','Контакты','<p style=\"text-align: center;\"></p><p style=\"text-align: center;\"><img src=\"/files/uploads/razrabotka.png\" width=\"344\" height=\"146\" /></p>','1','13','1','Контакты'),
('14','poleznaya-informatsiya','Полезная информация','Полезная информация','','Полезная информация','<p style=\"text-align: center;\"><img src=\"/files/uploads/razrabotka.png\" width=\"344\" height=\"146\" /></p>','1','14','1','Полезная информация'),
('1','','Главная','Главная','Доставка цветов в Смартилэнде','Главная','<p>Магазин цветов&nbsp;<a href=\"/\">Fiori.su</a>&nbsp;&nbsp;&mdash; это место, где любой желающий сможет через интернет заказать красивый и ароматный букетик изысканных цветов. Благодаря нашему сервису Вы получите свежие, благоухающие цветы с доставкой в любую точку Воронежа.</p>','1','1','0','Главная'),
('5','404','Страница не найдена','Страница не найдена','Страница    не найдена    Воспользуйтесь меню навигации выше','Страница не найдена','<p></p><p></p><p><img src=\"/files/uploads/404.png\" style=\"float: left; width: 30%; margin: 0px 40px 60px 40px;\" /></p><h1><span style=\"font-size: xx-large;\"><strong><br /></strong></span></h1><h1 style=\"text-align: left;\"><span style=\"font-size: xx-large;\"><strong>Страница&nbsp;</strong></span><strong style=\"font-size: xx-large;\">не найдена</strong></h1><p style=\"text-align: left;\"><span style=\"font-size: small;\">Воспользуйтесь меню навигации выше</span></p>','2','5','1','Страница не найдена'),
('8','about','О магазине','О магазине','В магазине цветов Fiori представлен широкий выбор авторских букетов, композиций из цветов и подарков высокого качества. Все букеты созданы нашими профессиональными флористами. На сайте представлены розы, хризантемы, герберы, альстромерии, лизиантусы, лилии, ирисы, тюльпаны, а также экзотические цветы и многое другое. Мы производим закупки напрямую у поставщиков Голландии, Эквадора и России, поэтому у нас недорогие цены и свежие цветы.','О магазине','<h1>ИНТЕРНЕТ МАГАЗИН ЦВЕТОВ В ВОРОНЕЖЕ</h1><p style=\"text-align: center;\"><img src=\"/files/uploads/2.jpg\" style=\"width: 85%;\" /></p><p style=\"text-align: center;\"></p><p>В магазине цветов Fiori представлен широкий выбор авторских букетов, композиций из цветов и подарков высокого качества. Все букеты созданы нашими профессиональными флористами. На сайте представлены розы, хризантемы, герберы, альстромерии, лизиантусы, лилии, ирисы, тюльпаны, а также экзотические цветы и многое другое. Мы производим закупки напрямую у поставщиков Голландии, Эквадора и России, поэтому у нас недорогие цены и свежие цветы.</p><p><span style=\"font-size: 13px;\">В Воронеже мы предоставляем следующие услуги:</span></p><ul><li>продажа цветов, букетов, подарков&nbsp;через интернет;</li><li>оперативная доставка заказа от 3 ч. получателю;</li><li>бесплатное<span style=\"font-size: 13px;\">&nbsp;фото получателя в момент доставки;</span></li><li>оформление мероприятий;</li><li>работа с корпоративными клиентами;</li><li>выполнение индивидуальных заказов любой сложности.</li></ul>','1','8','1','О магазине'),
('15','reviews','Отзывы','Отзывы клиентов о нашем салоне','','Отзывы клиентов о нашем салоне','','2','15','1','Отзывы клиентов о нашем салоне'),
