('20','kak-oplatit-zakaz','Как оплатить заказ','Как оплатить заказ','Оплатить свой заказ  Вы можете, на данный момент,  только наличными .     Оплата производится  при получении заказа  курьеру.                    Стоимость доставки:      Cтоимость доставки    БЕСПЛАТНАЯ!      (в черте города Воронеж).','Как оплатить заказ','<p><img src=\"/files/uploads/mceclip0-1485957659936.png\" style=\"float: left; margin: 0px 40px 10px 0px; width: 13%;\" /></p><p><strong style=\"font-size: 12px;\"><span style=\"color: #c72e89;\"><br /></span></strong></p><p><strong style=\"font-size: 13px;\"><span style=\"color: #c72e89; font-size: medium;\">Оплатить свой заказ </span>Вы можете, на данный момент,&nbsp;<span style=\"text-decoration-line: underline;\">только наличными</span>.</strong></p><p><span style=\"font-size: 13px;\"><strong>Оплата производится </strong>при получении заказа<strong> курьеру.</strong></span></p><p><span style=\"font-size: 13px;\"><strong><br /></strong></span></p><p></p><p></p><p></p><p></p><h2><span style=\"color: #c72e89;\">Стоимость доставки:&nbsp;</span></h2><ul><li><span style=\"font-size: 13px;\">Cтоимость доставки</span><span style=\"font-size: 13px;\">&nbsp;<strong>БЕСПЛАТНАЯ!</strong></span><span style=\"font-size: 13px;\"><strong>&nbsp;</strong>(в черте города Воронеж).</span></li></ul><div></div><div></div><div style=\"text-align: center;\"><img src=\"/files/uploads/rabotaem.jpg\" style=\"width: 90%;\" /></div><p><span><br /></span></p>','2','20','1','Как оплатить заказ'),
