('28','kak-sdelat-zakaz','Как сделать заказ','Как сделать заказ','Для оформления через через интернет-магазин:      1. Выбираем  необходимый товар.       2. Отправляем товар в корзину.  При нажатии кнопки &laquo;КУПИТЬ&raquo; выбранный товар автоматически отправляется в корзину, где вы можете либо оформить заказ, либо откорректировать его.   3. Корзина.  Для проверки корзины и оформления заказа вам необходимо перейти в раздел &laquo;Корзина&raquo;. Проверьте все товары, находящиеся в данном разделе, вы можете изменить их количество или удалить ненужные позиции','Как сделать заказ','<p><img src=\"/files/uploads/zakaz.jpg\" style=\"display: block; width: 60%; margin-left: auto; margin-right: auto;\" /></p><h2><strong><span style=\"color: #c72e89;\">Для оформления через через интернет-магазин:&nbsp;</span></strong></h2><p><strong>1. Выбираете&nbsp; необходимый товар.</strong><span>&nbsp;</span></p><p><strong>2. Отправляете товар в корзину.&nbsp;</strong>При нажатии кнопки &laquo;КУПИТЬ&raquo; выбранный товар автоматически отправляется в корзину, где вы можете либо оформить заказ, либо откорректировать его.</p><p><strong>3. Корзина.&nbsp;</strong>Для проверки корзины и оформления заказа вам необходимо перейти в раздел &laquo;Корзина&raquo;. Проверьте все товары, находящиеся в данном разделе, вы можете изменить их количество или удалить ненужные позиции.</p><p><strong>4. Оформляем заказ.&nbsp;</strong>Для завершения заказа в &laquo;Корзине&raquo; вам необходимо нажать на кнопку &laquo;Оформить заказ&raquo; предварительно проверив все позиции и внеся всю необходимую информацию. После этого выбрать способ оплаты и нажать \"Закончить заказ\".</p><p><span style=\"font-size: 13px;\">После того, как Вы оформили заказ, через некоторое время с Вами свяжется наш менеджер для уточнения данных.</span></p><p><span style=\"font-size: 13px;\"><br /></span></p><h2><strong><span style=\"color: #c72e89;\">Для оформления по телефону:</span></strong></h2><p><span><strong>1. Позвонить на номер&nbsp;<span>телефона, который указан в шапке сайта&nbsp;</span><span>&uarr;</span></strong><span class=\"pk\">. Время работы&nbsp; с 8:00 до 20:00.</span></span></p><p><span><span class=\"pk\"><strong>2. Озвучить пожелания по букету.</strong>&nbsp; После чего наш менеджер подберет и предложит подходящие варианты.</span></span></p><p><span><span class=\"pk\"><strong>3. Орформить заказ.</strong> Если вас всё устроило, сообщаете менеждеру всю необходимую информацию и подтверждаете заказ.&nbsp;</span></span></p><p><span><span class=\"pk\"><br /></span></span></p><p><span><span class=\"pk\"><br /></span></span></p><p><span><span class=\"pk\"><br /></span></span></p><p style=\"text-align: right;\"><span><span class=\"pk\"><img src=\"/files/uploads/rabotaem.jpg\" style=\"width: 90%; display: block; margin-left: auto; margin-right: auto;\" /></span></span></p>','2','28','1','Как сделать заказ'),
('29','garantii','Гарантии','Гарантии','Мы дорожим своей репутацией и делаем все возможное для того, чтобы вы получали всегда только свежие и самые красивые цветы: специалисты нашей компании четко следят за соблюдением условий и сроков доставки, мы отслеживаем выполнение температурных режимов хранения, каждая поставка цветов перебирается вручную флористами.','Гарантии','<h2><span style=\"color: #c72e89;\">ГАРАНТИИ КАЧЕСТВА</span></h2><p><span style=\"font-size: 13px;\">Мы дорожим своей репутацией и делаем все возможное для того, чтобы вы получали всегда только свежие и самые красивые цветы: специалисты нашей компании четко следят за соблюдением условий и сроков доставки, мы отслеживаем выполнение температурных режимов хранения, каждая поставка цветов перебирается вручную флористами. До тех пор, пока цветы не поступят в руки клиенту, мы следим за их состоянием &ndash; от срезки и на протяжении всего срока доставки.</span></p><p>Наш пункт хранения цветов &laquo;Fiori&raquo; оборудован специальными климатическими камерами. Мы заботливо относимся к каждому цветку, сохраняя его свежесть и красоту даже в самую сильную жару. Поэтому мы можем гарантировать качество наших цветов. Чтобы цветы стояли дольше следуйте&nbsp;инструкции по уходу за букетом<span>.</span></p><h3></h3><h3><span style=\"color: #c72e89;\">ПОРЯДОК ВНЕСЕНИЯ ИЗМЕНЕНИЙ В ЗАКАЗ</span></h3><p>В любой момент времени, пока мы еще не начали собирать букет для передачи его на доставку, вы можете изменить свой заказ. Для этого нужно позвонить по телефону&nbsp;<span class=\"pk\">+7-473-203-85-70</span>&nbsp;и сообщить менеджеру, что необходимо изменить. Мы будем вам очень благодарны, если вы сможете предупредить нас об изменениях за 48 часов до того момента, когда букет уже должен быть доставлен. Вы также можете внести изменения в уже собранный заказ и в заказ, который находится на доставке, но скорее всего это увеличит бюджет вашей покупки.</p><h3></h3><h3><span style=\"color: #c72e89;\">ПОРЯДОК ЗАМЕНЫ БУКЕТА</span></h3><p>В случае возникновения любых спорных вопросов или недовольства качеством цветов, позвоните нам по телефону&nbsp;<span class=\"pk\">+7-473-203-85-70</span>&nbsp;в течение 24 часов с момента доставки. Если букет плохого качества,&nbsp; необходима будет фотография букета и краткое описание ситуации. Наш менеджер по качеству свяжется с вами в течение 24-х часов.&nbsp;</p>','2','29','1','Гарантии');
