('2','Webmoney','Webmoney wmz','webmoney_icon_100.png','<p></p><div><p>Оплата через платежную систему&nbsp;<a href=\"http://www.webmoney.ru\">WebMoney</a>. У вас должен быть счет в этой системе для того, чтобы произвести оплату. Сразу после оформления заказа вы будете перенаправлены на специальную страницу системы WebMoney, где сможете произвести платеж в титульных знаках WMZ.</p></div><p>&nbsp;</p>','3','a:2:{s:5:\"purse\";s:13:\"Z111111111111\";s:10:\"secret_key\";s:13:\"testsecretkey\";}','0','6'),
('3','Robokassa','Робокасса','','<p><span>ROBOKASSA &ndash; сервис для организации приема платежей на сайте, интернет магазине и социальных сетях. Прием платежей осуществляется при минимальных комиссиях.</span></p>','3','a:4:{s:5:\"login\";s:0:\"\";s:9:\"password1\";s:0:\"\";s:9:\"password2\";s:0:\"\";s:8:\"language\";s:2:\"ru\";}','0','8'),
('4','Paypal','PayPal','','<p>Совершайте покупки безопасно, без раскрытия информации о своей кредитной карте. PayPal защитит вас, если возникнут проблемы с покупкой.</p>','1','a:2:{s:8:\"business\";s:0:\"\";s:4:\"mode\";s:7:\"sandbox\";}','0','9'),
('5','Interkassa','Оплата через Интеркассу','','<p><span>Это удобный в использовании сервис, подключение к которому позволит Интернет-магазинам, веб-сайтам и прочим торговым площадкам принимать все возможные формы оплаты в максимально короткие сроки.</span></p>','2','a:2:{s:18:\"interkassa_shop_id\";s:3:\"123\";s:21:\"interkassa_secret_key\";s:3:\"123\";}','0','10'),
('6','Liqpay','Оплата картой через Liqpay.com','','<p><span>Благодаря своей открытости и универсальности LiqPAY стремительно интегрируется со многими платежными системами и платформами и становится стандартом платежных операций.</span></p>','2','a:2:{s:17:\"liqpay_public_key\";s:0:\"\";s:18:\"liqpay_private_key\";s:0:\"\";}','0','11'),
('13','null','Наличными','nalik.jpg','<p>Расчет наличными деньгами по приезду курьера или самовывозе в одном из наших пунктов выдачи.</p>','2','N;','1','1'),
('7','Pay2Pay','Оплата через Pay2Pay','','<p>Универсальный платежный сервис Pay2Pay призван облегчить и максимально упростить процесс приема электронных платежей на Вашем сайте. Мы открыты для всего нового и сверхсовременного.</p>','2','a:5:{s:18:\"pay2pay_merchantid\";s:3:\"123\";s:14:\"pay2pay_secret\";s:3:\"123\";s:14:\"pay2pay_hidden\";s:3:\"123\";s:15:\"pay2pay_paymode\";s:3:\"123\";s:16:\"pay2pay_testmode\";s:1:\"1\";}','0','12'),
('8','Qiwi','Оплатить через QIWI','qiwi_icon_100.png','<p><span>QIWI &mdash; удобный сервис для оплаты повседневных услуг.</span></p>','2','a:2:{s:10:\"qiwi_login\";s:3:\"123\";s:13:\"qiwi_password\";s:3:\"123\";}','0','13'),
('9','YandexMoney','Яндекс.Деньги','yandexmoney_icon_100.png','<p><span>Яндекс</span><span>.</span><span>Деньги</span><span>&nbsp;&mdash; доступный и безопасный способ платить за товары и услуги через интернет.</span></p>','2','a:5:{s:13:\"yandex_shopid\";s:2:\"90\";s:11:\"yandex_scid\";s:5:\"50938\";s:15:\"yandex_password\";s:20:\"rVOs4ZDVkfkqgpRlyXqn\";s:18:\"yandex_paymenttype\";s:2:\"PC\";s:15:\"yandex_testmode\";s:1:\"1\";}','0','2'),
