('11','YandexMoney','Через терминал','','<p>Оплатита наличными через многочисленные терминалы в любом городе России. Можно заплатить и с банковской карты через многие банкоматы. Для этого найдите в меню терминала или банкомата логотип Яндекса и укажите код платежа.</p>','2','a:5:{s:13:\"yandex_shopid\";s:2:\"90\";s:11:\"yandex_scid\";s:5:\"50938\";s:15:\"yandex_password\";s:20:\"rVOs4ZDVkfkqgpRlyXqn\";s:18:\"yandex_paymenttype\";s:2:\"GP\";s:15:\"yandex_testmode\";s:1:\"1\";}','0','4'),
('12','YandexMoney','Со счета мобильного телефона','','<p><span>Оплата со&nbsp;счета мобильного телефона&nbsp;через систему Яндекс.Деньги</span></p>','2','a:5:{s:13:\"yandex_shopid\";s:2:\"90\";s:11:\"yandex_scid\";s:5:\"50938\";s:15:\"yandex_password\";s:20:\"rVOs4ZDVkfkqgpRlyXqn\";s:18:\"yandex_paymenttype\";s:2:\"MC\";s:15:\"yandex_testmode\";s:1:\"1\";}','0','5');
